import { IonButton, IonButtons, IonCard, IonCol, IonContent, IonGrid, IonHeader, IonIcon, IonInput, IonItem, IonLabel, IonMenuButton, IonPage, IonRow, IonTitle, IonToolbar } from '@ionic/react';
import { add, checkmark, close, pencil, text } from 'ionicons/icons';
import { useState, useEffect } from 'react';
import { useHistory, useParams, useRouteMatch } from 'react-router';
import ExploreContainer from '../../components/ExploreContainer';
import Employee from './Employee';
import {removeEmployee, saveEmployee, searchEmployeeById } from './EmployeeApi';


const EmployeeEdit: React.FC = () => {

    const { name } = useParams<{ name: string}>();

    const [employee,setEmployee] = useState<Employee>({});
    const history = useHistory();

    const routeMatch: any = useRouteMatch("/page/employee/:id");
    const id = routeMatch?.params?.id;
    useEffect(() => {
        search();
    }, [history.location.pathname]);

    const search = async ()=> {
        if(id === 'new'){
           setEmployee({});   
        }
        else{
            let result = await searchEmployeeById(id);
            setEmployee(result);
        }
   }

    const save = async() =>{
        await saveEmployee(employee);
        history.push('/page/employees')
    }


    return (
        <IonPage>
            <IonHeader>
                <IonToolbar>
                    <IonButtons slot="start">
                        <IonMenuButton />
                    </IonButtons>
                    <IonTitle>{name}</IonTitle>
                </IonToolbar>
            </IonHeader>

            <IonContent fullscreen>
                <IonHeader collapse="condense">
                    <IonToolbar>
                        <IonTitle size="large">{name}</IonTitle>
                    </IonToolbar>
                </IonHeader>



                <IonContent>
                    <IonCard>
                    <IonTitle>{id==='new'? 'Agregar Empleado' : 'Editar Empleado'}</IonTitle>



                    <IonRow>
                    <IonCol>

                    <IonItem>
                        <IonLabel position="stacked">Nombre</IonLabel>
                        <IonInput onIonChange={e =>employee.firstname= String(e.detail.value)} value={employee.firstname}> </IonInput>
                    </IonItem>
                    </IonCol>

                    <IonCol>

                        <IonItem>
                            <IonLabel position="stacked">Apellido</IonLabel>
                            <IonInput onIonChange={e => employee.lastname=String(e.detail.value)} value={employee.lastname}> </IonInput>
                        </IonItem>
                    </IonCol>
                    </IonRow>
                    <IonRow>
                    <IonCol>
                        <IonItem>
                            <IonLabel position="stacked">Email</IonLabel>
                            <IonInput onIonChange={e => employee.email =String( e.detail.value)} value={employee.email}> </IonInput>
                        </IonItem>
                    </IonCol>

                    <IonCol>

                        <IonItem>
                        <IonLabel position="stacked">Direccion</IonLabel>
                        <IonInput onIonChange={e => employee.address=String( e.detail.value)} value={employee.address}> </IonInput>
                        </IonItem>

                    </IonCol>
                    <IonCol>

                        <IonItem>
                            <IonLabel position="stacked">Telefono</IonLabel>
                            <IonInput onIonChange={e => employee.phone=String( e.detail.value)  } value={employee.phone}> </IonInput>
                        </IonItem>

                    </IonCol>

                    </IonRow>

                    <IonItem>
                        <IonButton onClick={save} color='success' fill='solid' slot='end' size='default'>
                            <IonIcon icon={checkmark}/>
                            Guardar
                        </IonButton>
                    </IonItem>


                    </IonCard>
                </IonContent>





            </IonContent>
        </IonPage>
    );
};

export default EmployeeEdit;
